script: |
  super -f text -I q5911.spq | sort > q5911.out

inputs:
  - name: q5911.spq
    data: |
      SELECT ALL col2 / 80 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col0 BETWEEN + col2 * + - col0 AND - col2;
  - name: tab1

outputs:
  - name: q5911.out
    data: |
      0
      0
      1
